import React from 'react';
import { Switch, Route, Redirect } from 'react-router-dom'
import LandingPage from 'LandingPage'

function App() {
  return (
    <Switch>
      <Route exact path='/' component={LandingPage}/>
    </Switch>
  );
}

export default App;
